  `AskDestroyFlag` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否开具限期拆除通知书',
  `AskCorrectFlag` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否开具改正通知书',
  `AskCutFlag` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否开具停水停电通知书',
  `AuditStatus` varchar(36) NOT NULL DEFAULT 'none' COMMENT '审批状态',
