  `DiscoverTime` datetime NOT NULL COMMENT '发现时间',
  `PlanDestroyDate` date DEFAULT NULL COMMENT '计划拆除日期',
  `FinalPatrolTime` datetime DEFAULT NULL COMMENT '末次巡查时间',
  `FinalEnforceTime` datetime DEFAULT NULL COMMENT '末次执法时间',
  `DecorateStartTime` date DEFAULT NULL COMMENT '装修申请时间',
  `DecorateEndTime` date DEFAULT NULL COMMENT '装修截止日期',
  `Photo` varchar(36) DEFAULT NULL COMMENT '照片',
  `BuildingRemark` varchar(100) DEFAULT NULL COMMENT '台账备注',
  `AffirmFlag` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否确认上报',
  `SquadronLeader` varchar(36) DEFAULT NULL COMMENT '确认台账的人，此处为中队长ID',
  `DecreaseDate` date DEFAULT NULL COMMENT '上次台账自动降级的时间',
  `HarmAuditorId` varchar(36) DEFAULT NULL COMMENT '危害等级审批人的id',
  `HarmAuditStatus` varchar(36) NOT NULL DEFAULT 'null' COMMENT '危害审批状态',
  `HarmAuditorName` varchar(20) DEFAULT NULL COMMENT '危害审批人姓名',
  PRIMARY KEY (`BuildingId`),
  KEY `K_IllegalBuilding_1` (`BuildingNo`) USING BTREE,
  KEY `K_IllegalBuilding_2` (`GridId`) USING BTREE,
  KEY `K_IllegalBuilding_3` (`Area1`) USING BTREE,
  KEY `K_IllegalBuilding_4` (`CreateTime`) USING BTREE,
  KEY `K_IllegalBuilding_5` (`PlanDestroyDate`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

