  `RequiredFlag` tinyint(4) NOT NULL DEFAULT '1' COMMENT '是否必须',
  `ReadonlyFlag` tinyint(4) NOT NULL DEFAULT '0' COMMENT '是否只读',
  PRIMARY KEY (`ParamId`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

