  `GridId` varchar(36) NOT NULL COMMENT '网格ID',
  `RoleId` varchar(36) DEFAULT 'none' COMMENT '用户角色',
  PRIMARY KEY (`UserId`),
  KEY `K_UserInfo_1` (`OrgId`) USING BTREE,
  KEY `K_UserInfo_2` (`LoginUid`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

