-- ----------------------------
-- View structure for orgview1
-- ----------------------------
DROP VIEW IF EXISTS `orgview1`;
CREATE ALGORITHM=UNDEFINED DEFINER=`sa`@`%` SQL SECURITY DEFINER VIEW `orgview1` AS select `orginfo`.`OrgId` AS `OrgId`,`orginfo`.`OrgName` AS `OrgName`,`orginfo`.`ParentId` AS `ParentId`,`orginfo`.`OrderNo` AS `OrderNo`,`orginfo`.`StopFlag` AS `StopFlag`,`orginfo`.`Remark` AS `Remark`,`orginfo`.`OrgId` AS `OrgPath`,1 AS `OrgLevel` from `orginfo` where (`orginfo`.`ParentId` in ('0','root','ROOT')) ;

-- ----------------------------
-- View structure for orgview2
-- ----------------------------
DROP VIEW IF EXISTS `orgview2`;
CREATE ALGORITHM=UNDEFINED DEFINER=`sa`@`%` SQL SECURITY DEFINER VIEW `orgview2` AS select `o`.`OrgId` AS `OrgId`,`o`.`OrgName` AS `OrgName`,`o`.`ParentId` AS `ParentId`,`o`.`OrderNo` AS `OrderNo`,`o`.`StopFlag` AS `StopFlag`,`o`.`Remark` AS `Remark`,concat(`v`.`OrgPath`,',',`o`.`OrgId`) AS `OrgPath`,2 AS `OrgLevel` from (`orginfo` `o` join `orgview1` `v` on((`o`.`ParentId` = `v`.`OrgId`))) ;

-- ----------------------------
-- View structure for orgview3
-- ----------------------------
DROP VIEW IF EXISTS `orgview3`;
CREATE ALGORITHM=UNDEFINED DEFINER=`sa`@`%` SQL SECURITY DEFINER VIEW `orgview3` AS select `o`.`OrgId` AS `OrgId`,`o`.`OrgName` AS `OrgName`,`o`.`ParentId` AS `ParentId`,`o`.`OrderNo` AS `OrderNo`,`o`.`StopFlag` AS `StopFlag`,`o`.`Remark` AS `Remark`,concat(`v`.`OrgPath`,',',`o`.`OrgId`) AS `OrgPath`,3 AS `OrgLevel` from (`orginfo` `o` join `orgview2` `v` on((`o`.`ParentId` = `v`.`OrgId`))) ;

-- ----------------------------
-- View structure for orgview4
-- ----------------------------
DROP VIEW IF EXISTS `orgview4`;
CREATE ALGORITHM=UNDEFINED DEFINER=`sa`@`%` SQL SECURITY DEFINER VIEW `orgview4` AS select `o`.`OrgId` AS `OrgId`,`o`.`OrgName` AS `OrgName`,`o`.`ParentId` AS `ParentId`,`o`.`OrderNo` AS `OrderNo`,`o`.`StopFlag` AS `StopFlag`,`o`.`Remark` AS `Remark`,concat(`v`.`OrgPath`,',',`o`.`OrgId`) AS `OrgPath`,4 AS `OrgLevel` from (`orginfo` `o` join `orgview3` `v` on((`o`.`ParentId` = `v`.`OrgId`))) ;

-- ----------------------------
-- View structure for orgview5
-- ----------------------------
DROP VIEW IF EXISTS `orgview5`;
CREATE ALGORITHM=UNDEFINED DEFINER=`sa`@`%` SQL SECURITY DEFINER VIEW `orgview5` AS select `o`.`OrgId` AS `OrgId`,`o`.`OrgName` AS `OrgName`,`o`.`ParentId` AS `ParentId`,`o`.`OrderNo` AS `OrderNo`,`o`.`StopFlag` AS `StopFlag`,`o`.`Remark` AS `Remark`,concat(`v`.`OrgPath`,',',`o`.`OrgId`) AS `OrgPath`,5 AS `OrgLevel` from (`orginfo` `o` join `orgview4` `v` on((`o`.`ParentId` = `v`.`OrgId`))) ;

DROP VIEW IF EXISTS `gridview`;
CREATE ALGORITHM=UNDEFINED DEFINER=`sa`@`%` SQL SECURITY DEFINER VIEW `gridview` AS select `v`.`OrgId` AS `OrgId`,`v`.`OrgName` AS `OrgName`,`v`.`ParentId` AS `ParentId`,`v`.`OrderNo` AS `OrderNo`,`v`.`StopFlag` AS `StopFlag`,`v`.`Remark` AS `Remark`,`v`.`OrgPath` AS `OrgPath`,`v`.`OrgLevel` AS `OrgLevel` from `orgview3` `v` where ((`v`.`OrgName` like '%网格%') or (`v`.`OrgName` like '%组')) ;
-- ----------------------------
-- View structure for outpost
-- ----------------------------
DROP VIEW IF EXISTS `outpost`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `outpost` AS select `commoncode`.`ItemId` AS `ItemId`,`commoncode`.`TypeId` AS `TypeId`,`commoncode`.`CodeId` AS `CodeId`,`commoncode`.`CodeName` AS `CodeName`,`commoncode`.`ParentId` AS `ParentId`,`commoncode`.`StopFlag` AS `StopFlag`,`commoncode`.`OrderNo` AS `OrderNo` from `commoncode` where ((`commoncode`.`CodeName` not in ('编外职工','临聘','老工勤雇员','特保人员','雇员','临聘(文秘)')) and (`commoncode`.`OrderNo` = 0)) ;

-- ----------------------------
-- View structure for patrolchecklog
-- ----------------------------
DROP VIEW IF EXISTS `patrolchecklog`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `patrolchecklog` AS select `b`.`BuildingId` AS `BuildingId`,`b`.`GridId` AS `GridId`,`b`.`Address` AS `address`,`b`.`OwnerName` AS `OwnerName`,`b`.`OwnerTel` AS `OwnerTel`,ifnull(`b`.`CoverArea`,0) AS `coverArea`,ifnull(`b`.`BuildArea`,0) AS `buildArea`,`b`.`HarmfulCode` AS `HarmfulCode`,`p`.`ItemId` AS `patrolId`,`p`.`CreateTime` AS `patrolTime`,`p`.`Remark` AS `Remark`,`p`.`ChangeFlag` AS `changeFlag`,`pl`.`CheckFlag` AS `checkFlag`,`b`.`Area1` AS `Area1`,`b`.`BuildingNo` AS `BuildingNo`,`b`.`CreateTime` AS `CreateTime` from ((`patrolplan` `pl` join `illegalbuilding` `b` on(((`b`.`BuildingId` = `pl`.`BuildingId`) and (`pl`.`CheckFlag` is not null)))) join `patrolrecord` `p` on((`p`.`ItemId` = `pl`.`CheckFlag`))) ;

-- ----------------------------
-- View structure for patrollogall
-- ----------------------------
DROP VIEW IF EXISTS `patrollogall`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `patrollogall` AS select `tpl`.`BuildingId` AS `BuildingId`,`tpl`.`GridId` AS `GridId`,`tpl`.`address` AS `address`,`tpl`.`OwnerName` AS `OwnerName`,`tpl`.`OwnerTel` AS `OwnerTel`,`tpl`.`coverArea` AS `coverArea`,`tpl`.`buildArea` AS `buildArea`,`tpl`.`HarmfulCode` AS `HarmfulCode`,`tpl`.`patrolId` AS `patrolId`,`tpl`.`patrolTime` AS `patrolTime`,`tpl`.`Remark` AS `Remark`,`tpl`.`changeFlag` AS `changeFlag`,`tpl`.`checkFlag` AS `checkFlag`,`tpl`.`CreateTime` AS `createTime`,(select group_concat(`p`.`UserName` separator ',') from `patroluser` `p` where (`p`.`PatrolId` = `tpl`.`patrolId`)) AS `names`,ifnull((select group_concat(`m`.`MeasureCode` separator ',') from `patrolmeasure` `m` where (`m`.`PatrolId` = `tpl`.`patrolId`)),'') AS `measures` from `patrolchecklog` `tpl` union select `b`.`BuildingId` AS `BuildingId`,`b`.`GridId` AS `GridId`,`b`.`Address` AS `address`,`b`.`OwnerName` AS `OwnerName`,`b`.`OwnerTel` AS `OwnerTel`,ifnull(`b`.`CoverArea`,0) AS `coverArea`,ifnull(`b`.`BuildArea`,0) AS `buildArea`,`b`.`HarmfulCode` AS `HarmfulCode`,'' AS `patrolId`,`pl`.`PlanDate` AS `patrolTime`,'' AS `Remark`,NULL AS `changeFlag`,`pl`.`CheckFlag` AS `checkFlag`,`b`.`CreateTime` AS `CreateTime`,'' AS `names`,'' AS `measures` from (`patrolplan` `pl` join `illegalbuilding` `b` on(((`b`.`BuildingId` = `pl`.`BuildingId`) and isnull(`pl`.`CheckFlag`)))) ;

-- ----------------------------
-- View structure for teamview
-- ----------------------------
DROP VIEW IF EXISTS `teamview`;
CREATE ALGORITHM=UNDEFINED DEFINER=`sa`@`%` SQL SECURITY DEFINER VIEW `teamview` AS select `v`.`OrgId` AS `OrgId`,`v`.`OrgName` AS `OrgName`,`v`.`ParentId` AS `ParentId`,`v`.`OrderNo` AS `OrderNo`,`v`.`StopFlag` AS `StopFlag`,`v`.`Remark` AS `Remark`,`v`.`OrgPath` AS `OrgPath`,`v`.`OrgLevel` AS `OrgLevel` from `orgview2` `v` where (`v`.`OrgName` like '%中队') ;

-- ----------------------------
-- View structure for todayenforcelog
-- ----------------------------
DROP VIEW IF EXISTS `todayenforcelog`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `todayenforcelog` AS select `e`.`ItemId` AS `enforceId`,`e`.`BuildingId` AS `buildingId`,`e`.`EnforceDate` AS `enforceDate`,`b`.`GridId` AS `GridId`,`b`.`Address` AS `address`,`b`.`OwnerName` AS `OwnerName`,`b`.`OwnerTel` AS `OwnerTel`,ifnull(`b`.`CoverArea`,0) AS `coverArea`,ifnull(`b`.`BuildArea`,0) AS `buildArea`,`e`.`Leader` AS `leader`,`b`.`HarmfulCode` AS `harmfulCode`,`e`.`EnforceRemark` AS `enforceRemark`,`e`.`DestroyFlag` AS `destroyFlag` from (`enforcerecord` `e` join `illegalbuilding` `b` on(((`e`.`BuildingId` = `b`.`BuildingId`) and (date_format(now(),'%y-%m-%d') = date_format(`e`.`EnforceDate`,'%y-%m-%d'))))) ;

-- ----------------------------
-- View structure for todaypatrollog
-- ----------------------------
DROP VIEW IF EXISTS `todaypatrollog`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `todaypatrollog` AS select `p`.`ItemId` AS `patrolId`,`p`.`BuildingId` AS `buildingId`,`p`.`CreateTime` AS `patrolTime`,`b`.`GridId` AS `GridId`,`b`.`Address` AS `address`,`p`.`Remark` AS `Remark`,`b`.`OwnerName` AS `OwnerName`,`b`.`OwnerTel` AS `OwnerTel`,ifnull(`b`.`CoverArea`,0) AS `coverArea`,ifnull(`b`.`BuildArea`,0) AS `buildArea`,`b`.`HarmfulCode` AS `HarmfulCode`,`p`.`ChangeFlag` AS `changeFlag` from (`patrolrecord` `p` join `illegalbuilding` `b` on((`p`.`BuildingId` = `b`.`BuildingId`))) ;

-- ----------------------------
-- View structure for userex
-- ----------------------------
DROP VIEW IF EXISTS `userex`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `userex` AS select distinct `u`.`UserId` AS `UserId`,`o`.`OrgName` AS `OrgName`,`c`.`CodeName` AS `DutyName`,`u`.`UserName` AS `UserName`,`u`.`OrgId` AS `OrgId`,`u`.`DutyId` AS `DutyId`,`u`.`Mobile` AS `Mobile`,`u`.`ServiceFlag` AS `Inservice`,`u`.`LoginableFlag` AS `LoginableFlag`,`u`.`LoginUid` AS `LoginUid`,`u`.`LoginPwd` AS `LoginPwd`,`u`.`HireTime` AS `HireTime`,`u`.`FireTime` AS `FireTime`,`u`.`GridId` AS `GridId` from ((`userinfo` `u` join `orginfo` `o` on((`u`.`OrgId` = `o`.`OrgId`))) join `commoncode` `c` on((`u`.`DutyId` = `c`.`CodeId`))) ;

-- ----------------------------
-- View structure for usergridview
-- ----------------------------
DROP VIEW IF EXISTS `usergridview`;
CREATE ALGORITHM=UNDEFINED DEFINER=`sa`@`%` SQL SECURITY DEFINER VIEW `usergridview` AS select `v`.`OrgId` AS `OrgId`,`v`.`OrgName` AS `OrgName`,`v`.`ParentId` AS `ParentId`,`v`.`OrderNo` AS `OrderNo`,`v`.`StopFlag` AS `StopFlag`,`v`.`Remark` AS `Remark`,`v`.`OrgPath` AS `OrgPath`,`v`.`OrgLevel` AS `OrgLevel`,`u`.`UserId` AS `UserId`,`u`.`UserName` AS `UserName`,`u`.`LoginUid` AS `LoginUid` from (`gridview` `v` join `userinfo` `u` on((`v`.`OrgId` = `u`.`OrgId`))) union all select `v`.`OrgId` AS `OrgId`,`v`.`OrgName` AS `OrgName`,`v`.`ParentId` AS `ParentId`,`v`.`OrderNo` AS `OrderNo`,`v`.`StopFlag` AS `StopFlag`,`v`.`Remark` AS `Remark`,`v`.`OrgPath` AS `OrgPath`,`v`.`OrgLevel` AS `OrgLevel`,`u`.`UserId` AS `UserId`,`u`.`UserName` AS `UserName`,`u`.`LoginUid` AS `LoginUid` from ((`gridview` `v` join `teamview` `t` on((`v`.`ParentId` = `t`.`OrgId`))) join `userinfo` `u` on((`t`.`OrgId` = `u`.`OrgId`))) union all select `v`.`OrgId` AS `OrgId`,`v`.`OrgName` AS `OrgName`,`v`.`ParentId` AS `ParentId`,`v`.`OrderNo` AS `OrderNo`,`v`.`StopFlag` AS `StopFlag`,`v`.`Remark` AS `Remark`,`v`.`OrgPath` AS `OrgPath`,`v`.`OrgLevel` AS `OrgLevel`,`u`.`UserId` AS `UserId`,`u`.`UserName` AS `UserName`,`u`.`LoginUid` AS `LoginUid` from (`gridview` `v` join `userinfo` `u` on((`v`.`OrgPath` like concat(`u`.`OrgId`,'%')))) union all select `v`.`OrgId` AS `OrgId`,`v`.`OrgName` AS `OrgName`,`v`.`ParentId` AS `ParentId`,`v`.`OrderNo` AS `OrderNo`,`v`.`StopFlag` AS `StopFlag`,`v`.`Remark` AS `Remark`,`v`.`OrgPath` AS `OrgPath`,`v`.`OrgLevel` AS `OrgLevel`,`u`.`UserId` AS `UserId`,`u`.`UserName` AS `UserName`,`u`.`LoginUid` AS `LoginUid` from ((`gridview` `v` join `userinfo` `u`) join `orgview2` `o` on(((`u`.`OrgId` = `o`.`OrgId`) and (not((`o`.`OrgName` like '%中队')))))) ;

-- ----------------------------
-- Event structure for changeevent
-- ----------------------------
DROP EVENT IF EXISTS `changeevent`;
DELIMITER ;;
CREATE DEFINER=`sa`@`localhost` EVENT `changeevent` ON SCHEDULE EVERY 1 DAY STARTS '2017-01-16 19:00:00' ON COMPLETION PRESERVE ENABLE DO BEGIN


	SELECT *

	FROM cargpslogtwo;



	DELETE

	FROM cargpslogtwo;

END
;;
DELIMITER ;